import React from "react";
import Card from '@material-ui/core/Card';
let NotedContent=()=>{
    return(
        <>
        <Card className="note">
    <h4>The is the Heading</h4>
    <br/>
    <p>The content of the your note</p>
    </Card>
    </>
    )
}
export default NotedContent;
